import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import video from './videos/dna3.mp4'
import { Tabs, Tab } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const Video = () => {
  return (
    <div className="container">
      <video autoPlay playsInline muted src={video} loop="true" />
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Jumbotron>
          <h1>Bioinformatics:
            <p3> Learning Tools <Video /></p3>
          </h1>
          <div className="tab-wrapper">
            <div className='container-fluid' >
              <Tabs defaultActiveKey="Description">
               <Tab eventKey="Description" title="Description"></Tab>
                <Tab eventKey="GC Content" title="GC Content"></Tab>
                <Tab eventKey="Transcription" title="Transcription"></Tab>
              </Tabs>
            </div>
          </div>  
          </Jumbotron>
      </header>
    </div>

  );
}

export default App;
